content:
@cmclymer @USPS @ChelseaClinton I was a penpal kid and at one time had six: Ireland, Israel, Australia, Nigeria, Japan and West Virginia. 

Every postcard, every drawing, every letter was a thrill to receive and it was a thrill to go to the post office to use the gold-plated drop window. 

Always felt special.

